import React from 'react';

const serve = () => {
    return (
        <div className="container mx-auto px-4">
            <h1 className="text-3xl font-bold mt-8 mb-4">Our Services</h1>
            <ul className="list-disc">
                <li>Service 1</li>
                <li>Service 2</li>
                <li>Service 3</li>
                {/* Add more services as needed */}
            </ul>
        </div>
    );
};

export default serve;
